import Sidebar from "../../layout/Sidebar";
import Header from "../../layout/Header";
import MainAdmin from "../../layout/MainAdmin";
import Notification from "../../layout/Notifications";

function AdminPage() {
  return (
    <>
      <Header />
      <div class="dashboard">
        <Sidebar />
        <MainAdmin />
        <Notification />
      </div>
    </>
  );
}

export default AdminPage;
